import React from "react";

class Header extends React.Component {
  render() {
    return (
      <div className="header">
        <ul>
          <li>
            <a href="/about">about</a>
          </li>
          <li>
            <a href="/work">work</a>
          </li>
          <li>
            <a href="/contact">contact</a>
          </li>
        </ul>
      </div>
    );
  }
}

export default Header;
